 */

export const Profile = () => {
    useContentLoader();

    return (
        <div className="container">
            <div className="content">
                <div class="profile">
                    <h1>John Smith</h1>
                    <p>johnsmith@dal.ca</p>
                </div>
            </div>
        </div>
    )
}
